KPIMetrics_1.query:
q = load "${App.Datasets.LoyaltyLedger_ManualActions7.FullyQualifiedName}";

q_A = filter q by 'TransactionType' == "AdjustedPoints_Positive" && 'LoyaltyProgramCurrency_CurrencyType' == "NonQualifying";
q_A_Duration = filter q_A by {{row(ActivityDate_2.selection, [0], ["min", "max"]).asDateRange("date('TransactionJournal_ActivityDate_Year', 'TransactionJournal_ActivityDate_Month', 'TransactionJournal_ActivityDate_Day')")}};
q_A_CompareDuration = filter q_A by {{row(ActivityDate_3.selection, [0], ["min", "max"]).asDateRange("date('TransactionJournal_ActivityDate_Year', 'TransactionJournal_ActivityDate_Month', 'TransactionJournal_ActivityDate_Day')")}};

q_B = filter q by  'TransactionType' == "AccrualReversal" && 'LoyaltyProgramCurrency_CurrencyType' == "NonQualifying";
q_B_Duration = filter q_B by {{row(ActivityDate_2.selection, [0], ["min", "max"]).asDateRange("date('TransactionJournal_ActivityDate_Year', 'TransactionJournal_ActivityDate_Month', 'TransactionJournal_ActivityDate_Day')")}};
q_B_CompareDuration = filter q_B by {{row(ActivityDate_3.selection, [0], ["min", "max"]).asDateRange("date('TransactionJournal_ActivityDate_Year', 'TransactionJournal_ActivityDate_Month', 'TransactionJournal_ActivityDate_Day')")}};

q_C = filter q by 'TransactionType' == "RedemptionReversal" && 'LoyaltyProgramCurrency_CurrencyType' == "NonQualifying";
q_C_Duration = filter q_C by {{row(ActivityDate_2.selection, [0], ["min", "max"]).asDateRange("date('TransactionJournal_ActivityDate_Year', 'TransactionJournal_ActivityDate_Month', 'TransactionJournal_ActivityDate_Day')")}};
q_C_CompareDuration = filter q_C by {{row(ActivityDate_3.selection, [0], ["min", "max"]).asDateRange("date('TransactionJournal_ActivityDate_Year', 'TransactionJournal_ActivityDate_Month', 'TransactionJournal_ActivityDate_Day')")}};
result = group q_A_Duration by all full, q_B_Duration by all full, q_C_Duration by all full,q_A_CompareDuration by all full,q_B_CompareDuration by all full, q_C_CompareDuration by all;
result = foreach result generate sum(q_A_Duration.'Points') as 'AdjustedPoints_NQP', sum(q_B_Duration.'Points') as 'AccrualCancellation_NQP', sum(q_C_Duration.'Points') as 'RedemptionCancellation_NQP'
,(sum(q_A_Duration.'Points')- sum(q_A_CompareDuration.'Points'))/sum(q_A_CompareDuration.'Points')*100 as 'AdjustedPoints_NQP_percentage'
,(sum(q_B_Duration.'Points')- sum(q_B_CompareDuration.'Points'))/sum(q_B_CompareDuration.'Points')*100 as 'AccrualCancellation_NQP_percentage'
,(sum(q_C_Duration.'Points')- sum(q_C_CompareDuration.'Points'))/sum(q_C_CompareDuration.'Points')*100 as 'RedemptionCancellation_NQP_percentage';

