q_D = filter q by 'TransactionType' == "AccrualReversal" && 'LoyaltyProgramCurrency_CurrencyType' == "NonQualifying";
q_E = filter q by 'TransactionType' == "AccrualReversal";
q_F = filter q by 'TransactionType' == "RedemptionReversal" && 'LoyaltyProgramCurrency_CurrencyType' == "NonQualifying";
q_G = filter q by 'TransactionType' == "RedemptionReversal";


result = group q by 'LoyaltyProgramMemberId' full, q_B by 'LoyaltyProgramMemberId' full, q_C by 'LoyaltyProgramMemberId' full, q_D by 'LoyaltyProgramMemberId' full,q_E by 'LoyaltyProgramMemberId' full,q_F by 'LoyaltyProgramMemberId' full,q_G by 'LoyaltyProgramMemberId' full, currency by 'LoyaltyMemberId' full, hist by 'LoyaltyMemberTier_LoyaltyMemberId';

result = foreach result generate coalesce(first(q.'TransactionJournal_LoyaltyProgramMember_MemberName'),first(hist.'LoyaltyMemberTier_LoyaltyProgramMember_MemberName' ),first(currency.'LoyaltyProgramMember_MemberName'), first(q_B.'TransactionJournal_LoyaltyProgramMember_MemberName'), first(q_C.'TransactionJournal_LoyaltyProgramMember_MemberName'), first(q_D.'TransactionJournal_LoyaltyProgramMember_MemberName'),first(q_E.'TransactionJournal_LoyaltyProgramMember_MemberName'),first(q_F.'TransactionJournal_LoyaltyProgramMember_MemberName'),first(q_G.'TransactionJournal_LoyaltyProgramMember_MemberName')) as 'Member', 
first(q.'LoyaltyTierMember_LoyaltyTier_LoyaltyTierGroup_Name') as 'Tier Group',
first(q.'LoyaltyTierMember_LoyaltyTier_Name') as 'Tier',
count(q) as 'Modifications', sum(q_B.'Points') as 'Credited Points', sum(q_C.'Points') as 'Debited Points', 
count(q_E) as 'Accrual Reversals',
sum(q_D.'Points') as 'Accrued NQP Reversed',
count(q_G) as 'Redemption Reversals',
sum(q_F.'Points') as 'Redeemed NQP Reversed',

sum(currency.'PointsBalance') as 'Points Balance',count(hist) as 'Tier Changes', first(q.'TransactionJournal_LoyaltyProgramMember_MemberType') as 'Member Type',
date_diff("month", toDate(first(q.'TransactionJournal_LoyaltyProgramMember_EnrollmentDate_sec_epoch')), now()) as 'Membership Duration (in months)',
first(q.'TransactionJournal_LoyaltyProgramMember_LeadOrContactId') as 'LeadOrContactId', first(q.'TransactionJournal_LoyaltyProgramMember_LeadOrContactName') as 'Name';

