ImpactonPoints_2.query:
q = load "${App.Datasets.LoyaltyLedger_ManualActions7.FullyQualifiedName}";
q_E = filter q by 'TransactionType' == "AccrualReversal" && 'TransactionJournal_UsageType' == "Loyalty" && 'LoyaltyProgramCurrency_CurrencyType' == "Qualifying";
q_F = filter q by 'TransactionType' == "AdjustedPoints_Positive" && 'TransactionJournal_UsageType' == "Loyalty" && 'LoyaltyProgramCurrency_CurrencyType' == "Qualifying";
q_G = filter q by 'TransactionType' == "AdjustedPoints_Negative" && 'TransactionJournal_UsageType' == "Loyalty" && 'LoyaltyProgramCurrency_CurrencyType' == "Qualifying";
result = group q by ('ActivityDate_Year', 'ActivityDate_Month') full,
q_E by ('ActivityDate_Year', 'ActivityDate_Month') full, q_F by ('ActivityDate_Year', 'ActivityDate_Month') full,q_G by ('ActivityDate_Year', 'ActivityDate_Month');

result = foreach result generate coalesce(q.'ActivityDate_Year' + "~~~" + q.'ActivityDate_Month', q_E.'ActivityDate_Year' + "~~~" + q_E.'ActivityDate_Month', q_F.'ActivityDate_Year' + "~~~" + q_F.'ActivityDate_Month', q_G.'ActivityDate_Year' + "~~~" + q_G.'ActivityDate_Month') as 'ActivityDate_Year~~~ActivityDate_Month', 

sum(q_E.'Points')*-1 as 'Accrual Reversals', 
sum(q_F.'Points') as 'Credited Points',
